  },
  mounted() {
    this.headImg = localStorage.getItem('headImg') || ''
    this.nickName = localStorage.getItem('nickName') || ''
  },
  methods: {
    goSetting() {
      if (this.headImg && this.nickName) {
        Message.loading('正在退出登陆...', 1).then(() => {
          Message.success('退出登录成功！')
